import React, { useState, useEffect } from 'react';
import './DataOwnerPanel.css';

function DataOwnerPanel({ onLogout }) {
  const [tableData, setTableData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // 模拟从后端获取数据库数据
  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        // 这里应该是实际的 API 调用，现在用模拟数据
        const mockData = [
          { ID: "1", credit_rank: 6, income: 100000, age: 20 },
          { ID: "2", credit_rank: 5, income: 90000, age: 19 },
          { ID: "3", credit_rank: 6, income: 89700, age: 32 },
          { ID: "4", credit_rank: 6, income: 607000, age: 30 },
          { ID: "5", credit_rank: 5, income: 30070, age: 25 },
          { ID: "6", credit_rank: 6, income: 12070, age: 28 },
          { ID: "7", credit_rank: 6, income: 200800, age: 50 },
          { ID: "8", credit_rank: 6, income: 607000, age: 30 },
          { ID: "9", credit_rank: 5, income: 30070, age: 25 },
          { ID: "10", credit_rank: 5, income: 12070, age: 28 },
          { ID: "11", credit_rank: 6, income: 200800, age: 50 },
          { ID: "12", credit_rank: 5, income: 30070, age: 25 },
          { ID: "13", credit_rank: 5, income: 12070, age: 28 },
          { ID: "14", credit_rank: 6, income: 200800, age: 18 },
          { ID: "15", credit_rank: 5, income: 30070, age: 26 },
          { ID: "16", credit_rank: 5, income: 12070, age: 27 },
          { ID: "17", credit_rank: 6, income: 200800, age: 16 },
          { ID: "18", credit_rank: 6, income: 30070, age: 25 },
          { ID: "19", credit_rank: 5, income: 12070, age: 28 }
        ];

        // 模拟网络延迟
        await new Promise(resolve => setTimeout(resolve, 500));
        setTableData(mockData);
        setLoading(false);
      } catch (err) {
        setError('获取数据失败');
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  // 如果有实际的后端 API，替换为：
  /*
  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        const response = await fetch('http://your-api-endpoint/user_credit');
        const data = await response.json();
        setTableData(data);
        setLoading(false);
      } catch (err) {
        setError('获取数据失败');
        setLoading(false);
      }
    };

    fetchData();
  }, []);
  */

  const handleUpload = () => {
    // 这里实现上传到云端的逻辑
    alert('开始上传数据库到云端...');
  };

  const handleSyncSettings = () => {
    // 这里实现同步设置的逻辑
    alert('打开同步设置...');
  };

  if (loading) {
    return (
      <div className="data-owner-container">
        <div className="loading-spinner">正在加载数据...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="data-owner-container">
        <div className="error-message">{error}</div>
      </div>
    );
  }

  return (
    <div className="data-owner-container">
      {/* 顶部导航栏 */}
      <div className="owner-header">
        <div className="header-left">
          <h1>CryptoDB</h1>
          <span className="role-badge">数据拥有者模式</span>
        </div>
        <button className="logout-btn" onClick={onLogout}>
          退出登录
        </button>
      </div>

      {/* 主内容区域 */}
      <div className="owner-content">
        {/* 数据库表格面板 */}
        <div className="database-panel">
          <div className="panel-header">
            <h2>USER_CREDIT 数据表</h2>
            <span className="record-count">共 {tableData.length} 条记录</span>
          </div>

          <div className="table-container">
            <table className="data-table">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>CREDIT_RANK</th>
                  <th>INCOME</th>
                  <th>AGE</th>
                </tr>
              </thead>
              <tbody>
                {tableData.map((row, index) => (
                  <tr key={index} className={index % 2 === 0 ? 'even-row' : 'odd-row'}>
                    <td>{row.ID}</td>
                    <td>{row.credit_rank}</td>
                    <td>{row.income.toLocaleString()}</td>
                    <td>{row.age}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>

        {/* 右侧操作面板 */}
        <div className="operations-panel">
          <div className="panel-header">
            <h2>数据库操作</h2>
          </div>
          <div className="operations-content">
            <button className="upload-btn" onClick={handleUpload}>
              上传到云端
            </button>
            <button className="settings-btn" onClick={handleSyncSettings}>
              同步设置
            </button>

            <div className="database-info">
              <h3>数据库信息</h3>
              <div className="info-item">
                <label>表名:</label>
                <span>user_credit</span>
              </div>
              <div className="info-item">
                <label>记录数:</label>
                <span>{tableData.length}</span>
              </div>
              <div className="info-item">
                <label>最后更新:</label>
                <span>{new Date().toLocaleString()}</span>
              </div>
            </div>

            <div className="sync-status">
              <label>同步状态:</label>
              <span className="status-idle">就绪</span>
            </div>
            <div className="progress-bar">
              <div className="progress-fill"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default DataOwnerPanel;
